import React from "react";
import Game from "./components/game";
import HowToPlay from "./components/howToPlay";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HowToPlay />
        <Game />
      </header>
    </div>
  );
}

export default App;
